import React from 'react';
import Displayer from '../components/Displayer';

const Details = () => (
  <div className="details">
    <div className="head">
      <img src="./" alt="continent" className="continent" />
      <div className="head-data">
        <h4 className="title">Finland</h4>
        <h6 className="views">6.958 views</h6>
      </div>
    </div>
    <Displayer />
  </div>
);
export default Details;
